In Battleship zien we hoe de vloot van de marine het moet opnemen tegen buitenaardse wezens die het op de aardse watervoorraad 
voorzien hebben. Opgesloten in een buitenaards krachtveld van meer dan 480 kilometer, moeten 5 wereldse schepen en 5 
buitenaardse schepen het zonder enige vorm van communicatie tegen elkaar opnemen in een strijd voor het leven - het lot van de 
wereld staat op het spel. Er wordt gevochten als David en Goliath - is inventiviteit, strategie en ouderwetse spierkracht genoeg 
om de buitenaardse wezens te verslaan?
